import React, { Component } from 'react';
import 'materialize-css/dist/css/materialize.min.css';
import './pagination.css';

class Pagination extends Component {
    constructor() {
        this.state = {
            currentPage: 1,
        }
    }
    changePage() {

    }
    render() {
        return (
            <ul className="pagination">
                <li className="{ this.state.currentPage === 1 ? 'disabled' : '' }"><a href="#!"><i class="material-icons">chevron_left</i></a></li>
                <li className="{ this.state.currentPage === 1 ? 'active' : '' }"><a onClick={this.changePage()}>1</a></li>
                <li className="waves-effect"><a onClick={ this.changePage() }>2</a></li>
                <li className="waves-effect"><a onClick={this.changePage()}>3</a></li>
                <li className="waves-effect"><a onClick={this.changePage()}>4</a></li>
                <li className="waves-effect"><a onClick={this.changePage()}><i class="material-icons">chevron_right</i></a></li>
            </ul>
        );
    }
}

export default Pagination;
